      .test-error-container {
        position: relative;
        white-space: pre;
        flex: none;
        padding: 0;
        background-color: var(--color-canvas-subtle);
        border-radius: 6px;
        line-height: initial;
        margin-bottom: 6px;
      }
      .test-error-view {
        overflow: auto;
        padding: 16px;
      }
      .test-error-text {
        font-family: monospace;
      }
      .test-result {
        flex: auto;
        display: flex;
        flex-direction: column;
        margin-bottom: 24px;
      }
      .test-result > div {
        flex: none;
      }
      .test-result video,
      .test-result img.screenshot {
        flex: none;
        box-shadow: var(--box-shadow-thick);
        margin: 24px auto;
        min-width: 200px;
        max-width: 80%;
      }
      .test-result-path {
        padding: 0 0 0 5px;
        color: var(--color-fg-muted);
      }
      .test-result-counter {
        border-radius: 12px;
        color: var(--color-canvas-default);
        padding: 2px 8px;
      }
      :root.light-mode .test-result-counter {
        background: var(--color-scale-gray-5);
      }
      :root.dark-mode .test-result-counter {
        background: var(--color-scale-gray-3);
      }
      @media only screen and (max-width: 600px) {
        .test-result {
          padding: 0 !important;
        }
      }
      .test-file-test {
        line-height: 32px;
        align-items: center;
        padding: 2px 8px;
        overflow: hidden;
        text-overflow: ellipsis;
      }
      .test-file-test:hover {
        background-color: var(--color-canvas-subtle);
      }
      .test-file-title {
        font-weight: 600;
        font-size: 16px;
      }
      .test-file-details-row {
        padding: 0 0 6px 8px;
        margin: 0 0 0 15px;
        line-height: 16px;
        font-weight: 400;
        color: var(--color-fg-muted);
        display: flex;
        align-items: center;
      }
      .test-file-details-row-items {
        display: flex;
        height: 16px;
      }
      .test-file-details-row-items > .link-badge {
        margin-top: -2px;
      }
      .test-file-details-row-items > .trace-link {
        margin-top: -4px;
      }
      .test-file-path {
        text-overflow: ellipsis;
        overflow: hidden;
        color: var(--color-fg-muted);
      }
      .test-file-path-link {
        margin-right: 10px;
      }
      .test-file-test-outcome-skipped {
        color: var(--color-fg-muted);
      }
      .test-file-test-status-icon {
        flex: none;
      }
      .test-file-header-info {
        display: flex;
        align-items: center;
        gap: 4px 8px;
        color: var(--color-fg-muted);
      }
      .test-file-header-br {
        flex-basis: 100%;
        height: 0;
      }
      .test-file-no-files {
        margin-top: 12px;
        color: var(--color-fg-muted);
        background-color: unset;
        font-weight: unset;
        border: 1px solid var(--color-border-default);
        border-bottom-left-radius: 6px;
        border-bottom-right-radius: 6px;
      }
      #root {
        color: var(--color-fg-default);
        font-size: 14px;
        font-family:
          -apple-system,
          BlinkMacSystemFont,
          Segoe UI,
          Helvetica,
          Arial,
          sans-serif,
          'Apple Color Emoji',
          'Segoe UI Emoji';
        -webkit-font-smoothing: antialiased;
      }
      .metadata-toggle {
        cursor: pointer;
        -webkit-user-select: none;
        user-select: none;
        color: var(--color-fg-default);
      }
      .metadata-toggle-second-line {
        margin-top: 8px;
        margin-left: 8px;
      }
      .metadata-view {
        border: 1px solid var(--color-border-default);
        border-radius: 6px;
        margin-top: 12px;
      }
      .metadata-view .metadata-section {
        margin: 8px 10px 8px 32px;
      }
      .metadata-view span:not(.copy-button-container),
      .metadata-view a {
        display: inline-block;
        line-height: 24px;
      }
      .metadata-properties {
        display: flex;
        flex-direction: column;
        align-items: normal;
        gap: 8px;
      }
      .metadata-properties > div {
        height: 24px;
      }
      .metadata-separator {
        height: 1px;
        border-bottom: 1px solid var(--color-border-default);
      }
      .metadata-view a {
        color: var(--color-fg-default);
      }
      .copyable-property {
        white-space: pre;
      }
      .copyable-property > span {
        display: flex;
        align-items: center;
      }
    </style>
  </head>
  <body>
    <div id="root"></div>
  </body>
</html>
